export {}

export class Exercicio {

    nome: string
    nm_repeticoes: string
    nm_series: string

    constructor(nm: string,
                rep: string,
                ser: string){

        this.nome = nm;
        this.nm_repeticoes = rep;
        this.nm_series = ser;
    }
}

export class ComposicaoCorporal {

    peso: string
    altura: string
    imc: string
    idade_metabolica: string
    massa_magra: string
    massa_gorda: string

    constructor(peso: string,
                altura: string,
                imc: string,
                idade_metabolica: string,
                massa_magra: string,
                massa_gorda: string) {

        this.peso = peso;
        this.altura = altura;
        this.imc = imc;
        this.idade_metabolica = idade_metabolica;
        this.massa_magra = massa_magra;
        this.massa_gorda = massa_gorda;
    }
}

export class Perimetros {

    cintura: string
    abdomen: string
    ombro: string
    torax: string
    braço_dir: string
    braço_esq: string
    coxa_dir: string
    coxa_esq: string
    gemeo_dir: string
    gemeo_esq: string
    antebraço_dir: string
    antebraço_esq: string

    constructor(cintura: string,
                abdomen: string,
                ombro: string,
                torax: string,
                braço_dir: string,
                braço_esq: string,
                coxa_dir: string,
                coxa_esq: string,
                gemeo_dir: string,
                gemeo_esq: string,
                antebraço_dir: string,
                antebraço_esq: string) {

        this.cintura = cintura;
        this.abdomen = abdomen;
        this.ombro = ombro;
        this.torax = torax;
        this.braço_dir = braço_dir;
        this.braço_esq = braço_esq;
        this.coxa_dir = coxa_dir;
        this.coxa_esq = coxa_esq;
        this.gemeo_dir = gemeo_dir;
        this.gemeo_esq = gemeo_esq;
        this.antebraço_dir = antebraço_dir;
        this.antebraço_esq = antebraço_esq;
    }
}

export class Avaliacao {

    composicao_corporal: ComposicaoCorporal
    perimetros: Perimetros

    peso: string
    altura: string
    imc: string
    idade_metabolica: string
    massa_magra: string
    lista_exercicios: Array<Exercicio>

    constructor(peso: string,
                altura: string,
                imc: string,
                idade_metabolica: string,
                massa_magra: string,
                list: Array<Exercicio>) {

        this.peso = peso;
        this.altura = altura;
        this.imc = imc;
        this.idade_metabolica = idade_metabolica;
        this.massa_magra = massa_magra;
        this.lista_exercicios = JSON.parse(JSON.stringify(list))
    }
}
